import React from "react";
import ReactDOM from "react-dom";
import cars from "./practice";  // Assuming cars is an array of car objects

console.log(cars);

// Assuming cars is an array with objects like:
// const cars = [
//   { model: 'Tesla', topSpeed: 250, topColour: 'Red' },
//   { model: 'Honda', topSpeed: 180, topColour: 'Blue' },
// ];

ReactDOM.render(
  <table>
    <thead>
      <tr>
        <th>Brand</th>
        <th>Top Speed</th>
        <th>Top Colour</th>
      </tr>
    </thead>
    <tbody>
      {cars.map((car, index) => (
        <tr key={index}>
          <td>{car.model}</td>
          <td>{car.topSpeed}</td>
          <td>{car.topColour}</td>
        </tr>
      ))}
    </tbody>
  </table>,
  document.getElementById("root")
);
